            <p class="font-['Reenie_Beanie'] text-2xl font-semibold uppercase">
               Custom platforms?
            </p>

            <p>
              I build digital tools tailored to real jobs and real workflows. Here are a few
              examples:
            </p>

            <ul class="list-none">
              <li>
                 A complete platform for lawyers: case files, documents, agenda, video calls,
                payments & signatures
              </li>
              <li> Booking and management systems for studios, wellness centers or restaurants</li>
              <li> A custom mini-SaaS for independent creators: reservations, CRM, invoicing</li>
              <li> Back-office dashboards that no CMS or template can offer</li>
              <li>
                 Internal workflows to automate processes (requests, approvals, document uploads)
              </li>
            </ul>

            <p>
              These tools save time, improve organisation, and help businesses work smoothly every
              day.
            </p>
